import React, { Component } from 'react'

export default class Rodape extends Component {
    render() {
        return (
            <footer className="row fixed-bottom mt-2">
                <div className="col-12 bg-dark text-white p-1 text-center">
                    Rodapé
                </div>
            </footer>
        )
    }
}
